import {createBrowserRouter} from "react-router-dom";
import Home from "./pages/home/Home";
import Login from "./pages/Auth/Login";
import Register from "./pages/Auth/Register";
import App from "./App";
App
export const routes = createBrowserRouter([
    {
        path:'',
        element:<App/>,
        children:[
            {
                path: "/",
                element:<Home/>,
              },
              {
                  path: "/login",
                  element:<Login/>,
                },
                {
                  path: "/register",
                  element:<Register/>,
                },
        ]
    }
  ]);
